import React from 'react';
import styles from './appStyles.module.css';
const fruit = (props)=>{
    return(
         <div className={styles.third}>
           <table className={styles.first}>
                <tr>
                 <td className={styles.second}>{props.name}</td>
                 <td className={styles.second}>{props.price}</td>
                 <td className={styles.second}><button onClick={props.deleteFruitHandler}>Delete</button></td>
                </tr>      
           </table>
         </div>
    )
};

export default fruit;
